CREATE TABLE "Amati" (
    nosaukums character varying(1024) PRIMARY KEY,
    apraksts text,
    min_alga integer NOT NULL DEFAULT 0,
    max_alga integer NOT NULL DEFAULT 0
);
CREATE UNIQUE INDEX amati_pkey ON "Amati"(nosaukums text_ops);

CREATE TABLE "Lomas" (
    nosaukums character varying(30) PRIMARY KEY,
    apraksts text
);
CREATE UNIQUE INDEX lomas_pkey ON "Lomas"(nosaukums text_ops);

CREATE TABLE "Apmeklejuma_ierobezojumi" (
    id character varying(16) PRIMARY KEY,
    stundas_klatiene integer,
    stundas_attalinati integer
);
CREATE UNIQUE INDEX apmeklejuma_ierobezojumi_pkey ON "Apmeklejuma_ierobezojumi"(id text_ops);

CREATE TABLE "Uznemumi" (
    id character varying(16) PRIMARY KEY,
    nosaukums character varying(1024) NOT NULL,
    industrija character varying(256),
    darbinieku_skaits integer,
    galvenais_birojs text
);
CREATE UNIQUE INDEX uznemumi_pkey ON "Uznemumi"(id text_ops);

CREATE TABLE "Darbinieki" (
    id character varying(16) PRIMARY KEY,
    vards character varying(128) NOT NULL,
    uzvards character varying(128) NOT NULL,
    epasts character varying(254) NOT NULL,
    talr_nr character varying(15),
    pienemts_darba date NOT NULL,
    amats character varying(1024) NOT NULL REFERENCES "Amati"(nosaukums),
    alga bigint NOT NULL,
    uznemuma_id character varying(16) NOT NULL REFERENCES "Uznemumi"(id),
    apmeklejuma_ierobezojuma_id character varying(16) NOT NULL REFERENCES "Apmeklejuma_ierobezojumi"(id),
    lomas_nosaukums character varying(30) NOT NULL REFERENCES "Lomas"(nosaukums),
    sifreta_parole character varying(256)
);
CREATE UNIQUE INDEX darbinieki_pkey ON "Darbinieki"(id text_ops);

CREATE TABLE "Rekini" (
    id character varying(16) PRIMARY KEY,
    uznemuma_id character varying(16) NOT NULL REFERENCES "Uznemumi"(id),
    rekina_nr character varying(256) NOT NULL,
    izrakstisanas_datums date NOT NULL,
    apmaksa_lidz date NOT NULL,
    summa integer NOT NULL,
    statuss character varying(256) NOT NULL
);
CREATE UNIQUE INDEX rekini_pkey ON "Rekini"(id text_ops);

CREATE TABLE "Transportlidzekli" (
    auto_registracijas_nr character varying(16) PRIMARY KEY,
    uznemuma_id character varying(16) NOT NULL REFERENCES "Uznemumi"(id),
    marka character varying(256),
    modelis character varying(256),
    reg_gads integer,
    statuss character varying(256) NOT NULL,
    atrumkarba character varying(256),
    bakas_tilpums character varying(256),
    degvielas_veids character varying(256)
);
CREATE UNIQUE INDEX transportlidzekli_pkey ON "Transportlidzekli"(auto_registracijas_nr text_ops);

CREATE TABLE "Braucieni" (
    id character varying(16) PRIMARY KEY,
    auto_registracijas_nr character varying(16) NOT NULL REFERENCES "Transportlidzekli"(auto_registracijas_nr),
    darbinieka_id character varying(16) NOT NULL REFERENCES "Darbinieki"(id),
    sakuma_laiks timestamp without time zone NOT NULL,
    beigu_laiks timestamp without time zone NOT NULL,
    iemesls text,
    nobrauktie_kilometri integer,
    degvielas_atlikums character varying(256),
    brauciens_no character varying(256),
    brauciens_uz character varying(256)
);
CREATE UNIQUE INDEX braucieni_pkey ON "Braucieni"(id text_ops);

CREATE TABLE "Transportlidzeklu_rezervacijas" (
    id character varying(16) PRIMARY KEY,
    darbinieka_id character varying(16) NOT NULL REFERENCES "Darbinieki"(id),
    auto_registracijas_nr character varying(16) NOT NULL REFERENCES "Transportlidzekli"(auto_registracijas_nr),
    sakuma_laiks timestamp without time zone NOT NULL,
    beigu_laiks timestamp without time zone NOT NULL,
    iemesls text,
    planotie_kilometri integer,
    brauciens_no character varying(256),
    brauciens_uz character varying(256),
    rezervacijas_statuss character varying(256),
    brauciena_id character varying(16) REFERENCES "Braucieni"(id)
);
CREATE UNIQUE INDEX transportlidzeklu_rezervacijas_pkey ON "Transportlidzeklu_rezervacijas"(id text_ops);

CREATE TABLE "Biroji" (
    id character varying(16) PRIMARY KEY,
    adrese text NOT NULL,
    ietilpiba integer,
    uznemuma_id character varying(16) NOT NULL REFERENCES "Uznemumi"(id)
);
CREATE UNIQUE INDEX biroji_pkey ON "Biroji"(id text_ops);

CREATE TABLE "Darbavietas_veidi" (
    id character varying(16) PRIMARY KEY,
    nosaukums character varying(256) NOT NULL,
    apraksts text,
    ietilpiba integer
);
CREATE UNIQUE INDEX darbavietas_veidi_pkey ON "Darbavietas_veidi"(id text_ops);

CREATE TABLE "Darbavietas" (
    id character varying(16) PRIMARY KEY,
    biroja_id character varying(16) NOT NULL REFERENCES "Biroji"(id),
    vieta_biroja character varying(256),
    veida_id character varying(16) NOT NULL REFERENCES "Darbavietas_veidi"(id),
    statuss character varying(255)
);

CREATE UNIQUE INDEX darbavieta_pkey ON "Darbavietas"(id text_ops);

CREATE TABLE "Darba_laiki" (
    id character varying(16) PRIMARY KEY,
    darbinieka_id character varying(16) NOT NULL REFERENCES "Darbinieki"(id),
    datums date NOT NULL,
    stundas_klatiene integer NOT NULL DEFAULT 0,
    stundas_attalinati integer NOT NULL DEFAULT 0,
    uzdevums text,
    apraksts text,
    ieraksta_veids character varying(256),
    ieraksts_veikts timestamp without time zone NOT NULL,
    ieraksts_atjauninats timestamp without time zone
);
CREATE UNIQUE INDEX darba_laiki_pkey ON "Darba_laiki"(id text_ops);

